import {Btn, Container} from './style'

class Buttons extends React.Component{
      render(){
        return(
            <Container>
                <Title>Login</Title>
                <Title>Register</Title>           

               <Btn>Login</Btn>
               <Btn>Register</Btn>

            </Container>
        )
      }
}
export default Buttons
